request.description:
Finds collections in a Gallery.

#### Implementation Notes

Only Gallery Curators(Admins) can use this API endpoint.

#### Response Class

##### Model

```
Alteryx.Server.Models.BaseModels.Collection {
id (string),
collectionId (string),
name (string),
ownerId (string),
dateAdded (Date),
apps (array[Alteryx.Server.Models.BaseModels.ApplicationCollectionShare]),
schedules (array[Alteryx.Server.Models.BaseModels.ScheduleCollectionShare]),
insights (array[Alteryx.Server.Models.BaseModels.InsightCollectionShare]),
users (array[Alteryx.Server.Models.BaseModels.UserCollectionShare]),
subscriptions (array[Alteryx.Server.Models.BaseModels.SubscriptionCollectionShare]),
userGroups (array[Alteryx.Server.Models.BaseModels.UserGroupCollectionShare])
}
Alteryx.Server.Models.BaseModels.ApplicationCollectionShare {
appId (string),
dateAdded (Date),
addedById (string)
}
Alteryx.Server.Models.BaseModels.ScheduleCollectionShare {
scheduleId (string),
dateAdded (Date),
addedById (string)
}
Alteryx.Server.Models.BaseModels.InsightCollectionShare {
insightId (string),
dateAdded (Date),
addedById (string)
}
Alteryx.Server.Models.BaseModels.UserCollectionShare {
userId (string),
dateAdded (Date),
addedById (string),
activeDirectoryObject (Alteryx.Server.Common.Utility.ActiveDirectoryObject),
expirationDate (Date, optional),
permissions (Alteryx.Server.Models.BaseModels.CollectionPermissions)
}
Alteryx.Server.Common.Utility.ActiveDirectoryObject {
sid (string),
category (string) = ['Person' or 'Group'],
displayName (string),
name (string),
samAccountName (string)
}
Alteryx.Server.Models.BaseModels.CollectionPermissions {
collection (Alteryx.Server.Models.BaseModels.CollectionPermissions+LocalCollectionPermissions),
applications (Alteryx.Server.Models.BaseModels.CollectionPermissions+UpdatePermissions),
users (Alteryx.Server.Models.BaseModels.CollectionPermissions+GenericPermissions)
}
Alteryx.Server.Models.BaseModels.CollectionPermissions+LocalCollectionPermissions {
isAdmin (boolean)
}
Alteryx.Server.Models.BaseModels.CollectionPermissions+UpdatePermissions {
canAdd (boolean),
canRemove (boolean),
canUpdate (boolean)
}
Alteryx.Server.Models.BaseModels.CollectionPermissions+GenericPermissions {
canAdd (boolean),
canRemove (boolean)
}
Alteryx.Server.Models.BaseModels.SubscriptionCollectionShare {
subscriptionId (string),
dateAdded (Date),
addedById (string),
expirationDate (Date, optional),
optOutUsers (array[string]),
permissions (Alteryx.Server.Models.BaseModels.CollectionPermissions)
}
Alteryx.Server.Models.BaseModels.UserGroupCollectionShare {
userGroupId (string),
dateAdded (Date),
addedById (string),
expirationDate (Date, optional),
permissions (Alteryx.Server.Models.BaseModels.CollectionPermissions)
}
```

